// Set base style of vector data
function style(feature) {
  return {
    weight: 0,
    fillOpacity: 0,
    fillColor: '#e6a85f'
  };
}

// Assign specific idea to each layer based on geojson id
var getEachid = function (feature, layer){
  if (feature.type == "GeometryCollection"){
      layer._leaflet_id =  4
    }else if (feature.type == "Feature"){
      layer._leaflet_id = feature.properties.id
  }
}

// Add vector data to map
geojson = L.geoJson(bay_area, {
  style: style,
  onEachFeature: getEachid
}).addTo(map);


// Markers on click event
markers.on('click', function(e) {
  $("#info").empty()
  var id = e.layer.options.options.id
  var template = e.layer.options.options.template
  getData(id, template)
  geojson.resetStyle(map._layers[5])
  geojson.resetStyle(map._layers[2])
  geojson.resetStyle(map._layers[3])
  cali.resetStyle(map_cali._layers[4])
  switch (e.layer.options.title){
    case "Oakland": return map._layers[3].setStyle({fillColor: "#5cb5ae", color: '#09F',  fillOpacity: .7, dashArray: '3', weight: 1});
    case "Berkeley": return map._layers[2].setStyle({fillColor: "#a4c874", color: '#09F',  fillOpacity: .7, dashArray: '3', weight: 1});
    case "San Francisco City and County": return map._layers[5].setStyle({fillColor: "#e6a85f", color: '#09F',  fillOpacity: .7, dashArray: '3', weight: 1});
  }
});


// Get data from props.json and pushes through EJS template.
function getData(id, template){
  var url_location = window.location.origin + "/innovationlab/knowyourprops/js/props.json"
  $.getJSON(url_location, function(data) {
  }).done(function(data){
      var prop = data[id]
      var url = window.location.origin + "/innovationlab/knowyourprops/js/templates/" + template + ".ejs"
      var html = new EJS({url: url}).render(prop);
      $("#info").append(html)
  }).fail(function(jqxhr, textStatus, error){
    var err = textStatus + ", " + error;
    console.log( "Request Failed: " + err );
  });
}

// On click, clear styles.
markers.on('clusterclick', function(a) {
  $("#info").empty()
  geojson.resetStyle(map._layers[5])
  geojson.resetStyle(map._layers[2])
  geojson.resetStyle(map._layers[3])
  cali.resetStyle(cali_map._layers[4])
});


// Here is where the magic happens: Manipulate the z-index of tile layers,
// this makes sure our vector data shows up above the background map and
// under roads and labels.
var topPane = map._createPane('leaflet-top-pane', map.getPanes().mapPane);
var topLayer = L.mapbox.tileLayer('laurenbenichou.k18bc600').addTo(map);
topPane.appendChild(topLayer.getContainer());
topLayer.setZIndex(2);


