$('#info').on('click', '.click-arr', function () {
  if($(this).hasClass("active")){
    $("#info").removeClass("open")
    $(".click-arr").removeClass("active")
    $(".click-measure").removeClass("click-arr-open")
    $('#bg').removeClass("bg-open")
    $(".instruction").html("Click Here For More Info")

  }else{
    $("#info").addClass("open")
    $(".click-arr").addClass("active")
    $(".click-measure").addClass("click-arr-open")
    $('#bg').addClass("bg-open")
    $(".instruction").html("Click To Close")
  }
});
